import ForgotPassword from "./Pages/ForgotPassword";
import Login from "./Pages/Login";
import { BrowserRouter, Routes, Route } from "react-router-dom";
import UserManagement from "./Pages/UserManagement";
import ListenerMangement from "./Pages/ListenerMangement";
import CategoryManagement from "./Pages/CategoryManagement";
import PromoCodeManagement from "./Pages/PromoCodeManagement";
import AppointmentManagement from "./Pages/AppointmentManagement";
import SystemSupport from "./Pages/SystemSupport";
import MasterSettings from "./Pages/MasterSettings";
import Dashboard from "./Pages/Dashboard";
import ReviewsManagement from "./Pages/ReviewsManagement";
import PaymentManagement from "./Pages/PaymentManagement";
import AuditLog from "./Pages/AuditLog";
import WithdrawalRequest from "./Pages/WithdrawalRequest";
import ViewProfile from "./Pages/ViewProfile";
import Verification from "./Pages/Verification";
import { AuthProvider } from "./Components/AuthContext";
function App() {
  return (
    <>
      <BrowserRouter>
        <AuthProvider>
          <Routes>
            <Route path="/" element={<Login />} />
            <Route path="/forgotpassword" element={<ForgotPassword />} />
            <Route path="/dashboard" element={<Dashboard />} />
            <Route path="/user-management" element={<UserManagement />} />
            <Route path="/listener-management" element={<ListenerMangement />} />
            <Route path="/category-management" element={<CategoryManagement />} />
            <Route path="/promocode-management" element={<PromoCodeManagement />} />
            <Route path="/appointment-booking-management" element={<AppointmentManagement />} />
            <Route path="/system-support" element={<SystemSupport />} />
            <Route path="/master-settings" element={<MasterSettings />} />
            <Route path="/reviews-management" element={<ReviewsManagement />} />
            <Route path="/payment-management" element={<PaymentManagement />} />
            <Route path="/audit-log" element={<AuditLog />} />
            <Route path="/withdrawal-request" element={<WithdrawalRequest />} />
            <Route path='/view-profile' element={<ViewProfile />} />
            <Route path="/verification" element={<Verification />} />
          </Routes>
        </AuthProvider>
      </BrowserRouter>
    </>
  );
}

export default App;
